const tmp = require('tmp');
const fs = require('fs');
const { promisify } = require('util');
const scramAddon = require('../../build/Release/scram-node.node');

const writeFileAsync = promisify(fs.writeFile);
const readFileAsync = promisify(fs.readFile);

async function createTempFiles(models) {
  const files = [];
  for (const model of models) {
    const tempFile = tmp.fileSync({ prefix: 'models-', postfix: '.xml' });
    // Decode the Base64 string to UTF-8
    const modelContent = Buffer.from(model, 'base64').toString('utf8');
    await writeFileAsync(tempFile.name, modelContent);
    files.push(tempFile.name);
  }
  return files;
}

async function runScram(input) {
  try {
    // Create temporary files for models and update the input object
    if (input.models) {
      const tempFiles = await createTempFiles(input.models);
      input.models = tempFiles;
    }

    // Create a temporary output file and add to the input object
    const tempOutputFile = tmp.fileSync({ prefix: 'result', postfix: '.xml' }).name;
    input.output = tempOutputFile;

    scramAddon.RunScramCli(input, async (err) => {
      if (err) {
        console.error('Error:', err);
        return;
      }

      try {
        // Read the output XML file
        const outputContent = await readFileAsync(tempOutputFile, 'utf8');
        console.log('SCRAM CLI executed successfully. Output:', outputContent);
      } catch (readError) {
        console.error('Failed to read output file:', readError);
      } finally {
        // Cleanup: remove temporary files
        input.models.forEach(filePath => fs.unlinkSync(filePath));
        fs.unlinkSync(tempOutputFile); // Remove the output file after reading
      }
    });
  } catch (error) {
    console.error('Failed to run SCRAM CLI:', error);
  }
}

const input = {
  mocus: true,
  mcub: true,
  probability: true,
  models: [""]
}

runScram(input).then(() => {
  console.log('Done!');
});
